import React from "react";

const Header = () => {
    return (
        // Header
        <header class="w-full h-[4.5rem]
            fixed top-0 left-0
            flex items-center justify-center
            bg-slate-50
            z-20">
            {/* Content */}
            <div class="container px-3
                flex flex-row items-center justify-between
                h-full">
                {/* Logo */}
                <span>Logo</span>
                {/* Logo */}

                <input type="search" name="" id="" />
            </div>
            {/* Content */}
        </header>
    );

};

export default Header;
